import React from 'react';


export default class Teams extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
                <h3>{this.props.team}</h3>
                <button id = "edit">Edit</button>
                <button id = "delete" onClick={()=>{this.teams._id}}>Delete</button>
            </div>
        );
    }
}

Teams.defaultProps = {
    team: ''
};
